int ED(const char *x, const int x_len, const char *y, const int y_len)
{
    if(x_len > y_len) return ED(y, y_len, x, x_len);
    if(x_len==0) return y_len;

    int fc_buf[K+2], fp_buf[K+2];          
    int *fc = fc_buf + 1;
    int *fp = fp_buf + 1;                  
    int i, j;

    
    for(j = 0; j <= x_len; j++) {
        fp[j] = j;
        fc[j] = j;
    }

    for(i = 1; i <= y_len; i++) {
        std::swap(fc, fp);
        fc[0] = i;

        for(j = 1; j <= x_len; j++) {
            if(x[j-1] == y[i-1]) {
                //Match
                fc[j] = fp[j - 1];
            } else {
                // edit operations
                fc[j] = 1 + min(min(fp[j], fc[j - 1]), fp[j - 1]);
            }
        }
    }

    return fc[x_len];
}



int EDstarmin(const char *y, const int y_len, const char *x, const int x_len)
// returns the edit distance of the best prefix match of x to y.
{
    int fc_buf[K+2], fp_buf[K+2];          
    int *fc = fc_buf + 1;
    int *fp = fp_buf + 1;                  
    int i, j;

    
    for(j = 0; j <= x_len; j++) {
        fp[j] = j;
        fc[j] = j;
    }

    for(i = 1; i <= y_len; i++) {
        std::swap(fc, fp);
        fc[0] = i;

        for(j = 1; j <= x_len; j++) {
            if((x[j-1] == y[i-1])||(x[j-1]=='*')||(y[i-1]=='*')) {
                //Match
                fc[j] = fp[j - 1];
            } else {
                // edit operations
                fc[j] = 1 + min(min(fp[j], fc[j - 1]), fp[j - 1]);
            }
        }
    }

    int res=x_len+y_len;
    for(j=0;j<=x_len;j++)res = min(res, fc[j]); 

    return res;
}


int EDstarpref(const char *y, const int y_len, const char *x, const int x_len, int *res)
// returns the edit distance of all prefixes of y to x.
{

    int fc_buf[K+2], fp_buf[K+2];          
    int *fc = fc_buf + 1;
    int *fp = fp_buf + 1;                  
    int i, j;

    
    for(j = 0; j <= x_len; j++) {
        fp[j] = j;
        fc[j] = j;
    }

    res[0]=x_len;

    for(i = 1; i <= y_len; i++) {
        std::swap(fc, fp);
        fc[0] = i;

        for(j = 1; j <= x_len; j++) {
            if((x[j-1] == y[i-1])||(x[j-1]=='*')||(y[i-1]=='*')) {
                //Match
                fc[j] = fp[j - 1];
            } else {
                // edit operations
                fc[j] = 1 + min(min(fp[j], fc[j - 1]), fp[j - 1]);
            }
        }

        res[i]=fc[x_len];
    }

    return fc[x_len];
}


int EDstarprefnonstraight(const char *y, const int y_len, const char *x, const int x_len, int *res)
// returns the edit distance of all prefixes of y to x.
{

    int fc_buf[K+2], fp_buf[K+2];          
    int *fc = fc_buf + 1;
    int *fp = fp_buf + 1;                  
    int i, j;

    
    for(j = 0; j <= x_len; j++) {
        fp[j] = j;
        fc[j] = j;
    }

    res[0]=x_len;

    for(i = 1; i <= y_len; i++) {
        std::swap(fc, fp);
        fc[0] = i;

        for(j = 1; j <= x_len; j++) {
            if((i!=j)&&((x[j-1] == y[i-1])||(x[j-1]=='*')||(y[i-1]=='*'))) {
                //Match
                fc[j] = fp[j - 1];
            } else {
                // edit operations
                fc[j] = 1 + min(min(fp[j], fc[j - 1]), fp[j - 1]);
            }
        }

        res[i]=fc[x_len];
    }

    return fc[x_len];
}


int EDstardiagprefnonstraight(const char *y, const int y_len, const char *x, const int x_len, int *res)
// returns the edit distance of all prefixes of y to prefixes of the same size of x.
{

    int fc_buf[K+2], fp_buf[K+2];          
    int *fc = fc_buf + 1;
    int *fp = fp_buf + 1;                  
    int i, j;

    
    for(j = 0; j <= x_len; j++) {
        fp[j] = j;
        fc[j] = j;
    }

    res[0]=x_len;

    for(i = 1; i <= y_len; i++) {
        std::swap(fc, fp);
        fc[0] = i;

        for(j = 1; j <= x_len; j++) {
            if((i!=j)&&((x[j-1] == y[i-1])||(x[j-1]=='*')||(y[i-1]=='*'))) {
                //Match
                fc[j] = fp[j - 1];
            } else {
                // edit operations
                fc[j] = 1 + min(min(fp[j], fc[j - 1]), fp[j - 1]);
            }
        }

        res[i]=fc[i];
    }

    return fc[x_len];
}


