uint16_t Sed[COLSIZE][COLSIZE][LEN+1], Ped[COLSIZE][COLSIZE][LEN+1];
uint16_t G[COLSIZE][COLSIZE];
int degree[COLSIZE];

void resetgraph()
{
   for(int i=0;i<COLSIZE;i++){
      degree[i]=0;
      for(int j=0;j<COLSIZE;j++)G[i][j]=0;
   }
}

void addedge(int i, int j)
{
   if(G[i][j]==0){
      G[i][j]=1;
      degree[i]++;
   }
}

void removeedge(int i, int j)
{
   if(G[i][j]!=0){
      G[i][j]=0;
      degree[i]--;
   }
}

void removevertex(int j)
{
   for(int i=0;i<COLSIZE;i++)removeedge(i,j);
   degree[j]=0;
}


int maxdegreevertex()
// returns a random vertex of the largest degree
{
   int maxi,maxdeg,maxcnt,i;

   for(i=maxi=0,maxdeg=-1;i<COLSIZE;i++)
      if(maxdeg < degree[i]){ maxi=i; maxdeg = degree[i]; maxcnt = 1; }
      else if(maxdeg == degree[i])maxcnt++;

   int j=maxcnt/2;

   for(i=0;i<COLSIZE;i++)if(maxdeg == degree[i])if((j--)==0)return i;

   return maxi;

}

